const Footer = () => {
  return (
    <div className="fixed-bottom bg-dark">
      <div
        style={{
          height: "20px",
          backgroundColor: "none !impor",
          boxShadow: "0 12px 15px -4px gray"
        }}
      ></div>
      <footer className="flexible-navbar footer">
        <p className="pb-2 mt-2 text-center text-info">
          &copy; {new Date().getFullYear()} Copyright:{" "}
          <Link
            to="/"
            style={{ textDecoration: "none" }}
          >
            {" "}
            Amirreza Ghanei{" "}
          </Link>
        </p>
      </footer>
    </div>
  );
};

export default Footer;
